import logo from './logo.svg';
import './App.css';
import List from "./components/List";
import { Route, BrowserRouter as Router } from "react-router-dom";
import React, {useState, useEffect } from 'react'; 

function App() {
    const url = 'http://localhost:8000/api/clientes'
    const [clientes, setClientes] = useState()
    const fetchApi = async () => {
      const response = await fetch (url)
      const responseJSON = await response.json()
      setClientes(responseJSON)
    }
    useEffect( () => {
      fetchApi()
    }, [])
    return (

    <div className="App">
      <h1><b> Listado De Clientes</b></h1>
      <ul>
      { !clientes ? 'Loanding...' :
      clientes.map( (cliente, index)=>{
        return <table class="bg-gray-100 w-full">
        <thead>
          <tr class="bg-blue-100 border-b-2 border-yellow-400">
            <th>Nombre</th>
            <th>Apellido</th>
            <th>CÃ©dula</th>
            <td class="hidden sm:block">
              <input 
              class="bg-gray-100 focus:outline-none border-b border-gray-400 py-2 px-8 block w-full appearance-none leading-normal"
              id="filter"
              placeholder="Buscar..."
              type="text"
              />
            </td>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td class="bg-blue-200">{cliente.nombre}</td>
            <td>
              <b>{cliente.apellido}</b>
            </td>
            <td>{cliente.cedula}</td>
          </tr>
        </tbody>
      </table>
      })
      }
      </ul>
    </div> 
  );
}

export default App;
